import React, { useState } from "react";
import Footer from "./component/Footer";
import Main from "./component/Main";
import Navbar from "./component/Navbar";

function App() {
  const [darkMode, setDarkMode] = useState(true);
  return (
    <div className="container">
      <Navbar />
      <Main />
      <Footer />
    </div>
  );
}
export default App;
